import React from "react";

function Options() {
  return (
    <div class="form-check" align="center">
      <input
        class="form-check-input"
        type="checkbox"
        value=""
        id="flexCheckDefault"
      />
      <label class="form-check-label" for="flexCheckDefault">
        Default checkbox
      </label>
    </div>
  );
}

export default Options;

